import React, { Component } from "react";
import ResumeEducation from '../Resume-Education';
import Skills from '../Skills'
import "./Resume.scss";

export class Resume extends Component {
  render() {
    return (
      <section className="resume">
        <Skills />
        <ResumeEducation />
      </section>
    );
  }
}

export default Resume;
